We started this journey over 3 years ago, searching for extraordinary women with extraordinary stories to tell.

Our amazing teams worked so hard during these troubled times to bring these incredible stories to life, to shed light on the people doing good and making a difference.

Thank you Kameryn, Kelsey, Arianna, Kayla, Chief Shirell and Tuany, for trusting us with your stories. You let us into your homes, your lives, your communities and your hearts, and showed us what it truly means to make an impact on the world. 

Thank you Ryan for bringing this project to Jaron and I, and being an amazing partner throughout the whole process, thank you Vanessa Roth for breathing life and love into these moving stories. Thank you to the entire NatGeo and EOne teams for all your hard work and dedication, thank you Tara Long and Eric Levin for being the amazing partners . 

And finally, thank you to all the production teams who were on the ground. And our teams in post, our editors, our wonderful composer. Thank you for making each episode so powerful and emotional. 

Thank you ALL for making an IMPACT! 

@ryanpallotta #VanessaRoth
@jaronvarsano @pilotwavemotionpictures 
